Prabu Gercep

(Pelayanan Rabu Gerak Cepat) 
Rabu, 30 Juli 2025 Aparatur Kelurahan Jatimakmur melaksanakan kegiatan “PRABU GERCEP” (Pelayanan Rabu Gerak Cepat) yang mana kegiatan tersebut bertujuan untuk optimalisasi pelayanan administrasi kepada masyarakat dengan membuka gerai pelayanan diwilayah. 

Prabu Gercep menyediakan akses pelayanan publik berupa pelayanan kesehatan, pelayanan administrasi kependudukan, administrasi pelayanan kelurahan dan kegiatan kerja bakti lingkungan bersama Satlinmas Kelurahan Jatimakmur

